namespace Server.Items
{
    public class FoolsBall : Item
    {
        public static void Initialize()
        {
            CommandSystem.Register("FootBall", AccessLevel.GameMaster, new CommandEventHandler(FootBall_onCommand));
        }
        public static void FootBall_onCommand(CommandEventArgs e)
        {
            FoolsBall w = new FoolsBall();
            w.Map = e.Mobile.Map;
            w.Location = e.Mobile.Location;
        }
        public FoolsBall[] ballparts = new FoolsBall[8];
        public FoolsBall parent = null;
        [Constructable]
        public FoolsBall() : base(8790) 
        {
            this.Movable = false;
            this.Hue = 0x74E;
            this.Name = "a football";
            if (parent == null)
            {
                for (int i = 0; i < ballparts.Length; i++)
                {
                    ballparts[i] = new FoolsBall(this);
                }
            } 

        }   
        [Constructable]
        public FoolsBall(FoolsBall myParent) : base(2769)
        {
            parent = myParent;
            this.Visible = false;
            this.Movable = false;
        }
        public override void OnLocationChange(Point3D oldLocation)
        {
            base.OnLocationChange(oldLocation);

            if (parent == null)
            {
                ballparts[0].Location = new Point3D(X - 1, Y, Z);
                ballparts[0].Map = Map;
                ballparts[0].ItemID = 2774;
                ballparts[1].Location = new Point3D(X + 1, Y, Z);
                ballparts[1].Map = Map;
                ballparts[1].ItemID = 2776;
                ballparts[2].Location = new Point3D(X, Y + 1, Z);
                ballparts[2].Map = Map;
                ballparts[2].ItemID = 2777;
                ballparts[3].Location = new Point3D(X, Y - 1, Z);
                ballparts[3].Map = Map;
                ballparts[3].ItemID = 2775;
                ballparts[4].Location = new Point3D(X -1, Y - 1, Z);
                ballparts[4].Map = Map;
                ballparts[4].ItemID = 2771;
                ballparts[5].Location = new Point3D(X + 1, Y + 1, Z);
                ballparts[5].Map = Map;
                ballparts[5].ItemID = 2770;
                ballparts[6].Location = new Point3D(X - 1, Y + 1, Z);
                ballparts[6].Map = Map;
                ballparts[6].ItemID = 2772;
                ballparts[7].Location = new Point3D(X + 1, Y - 1, Z);
                ballparts[7].Map = Map;
                ballparts[7].ItemID = 2773;
            }else
            {
            }
        }

        public override void Delete()
        {
            if (parent == null)
            {
                for (int i = 0; i < ballparts.Length; i++)
                {
                    if (ballparts[0] != null) 
                    {
                    	ballparts[i].Delete();
                    }
                }
            }
            base.Delete();
        }
        public override bool OnMoveOver(Mobile m)
        {
            if (parent != null)
            {
                if (this == parent.ballparts[0])
                {
                    parent.X -= 1;
                }else if (this == parent.ballparts[1])
                {
                    parent.X += 1;
                }else if (this == parent.ballparts[2])
                {
                    parent.Y += 1;
                }else if (this == parent.ballparts[3])
                {
                    parent.Y -= 1;
                }else if (this == parent.ballparts[4])
                {
                    parent.X -= 1;
                    parent.Y -= 1;
                }else if (this == parent.ballparts[5])
                {
                    parent.X += 1;
                    parent.Y += 1;
                }else if (this == parent.ballparts[6])
                {
                    parent.X -= 1;
                    parent.Y += 1;
                }else if (this == parent.ballparts[7])
                {
                    parent.X += 1;
                    parent.Y -= 1;
                }
            }
            return true;
        }
        public FoolsBall( Serial serial ) : base( serial )
		{
		}
		public override void Serialize( GenericWriter writer )
		{
			base.Serialize( writer );
			writer.Write( 0 ); // Version
		}
		public override void	Deserialize( GenericReader reader )
		{
			base.Deserialize( reader );
			int version = reader.ReadInt();
			this.Delete();
		}
    }
}